import React, { Component } from "react";

class Header extends Component {
  render() {
    return (
      <div className="p-3 bg-gray-900 shadow-inner">
        <span className="text-gray-400 font-medium">
          JS Local wi-fi IPv4 ARP spoofer
        </span>
      </div>
    );
  }
}

export default Header;
